import React from 'react';

import './App.css';
import Header from "./Components/Header/Header";

let categories: string[] = [['СЕТЫ', ''], 'СЕТЫ', 'РОЛЛЫ', 'СУШИ', 'ПИЦЦА', 'САЛАТЫ', 'БУРГЕРЫ', 'ВОКИ', 'СУПЫ', 'ГАРНИРЫ', 'НАПИТКИ', 'ПОКЕ']


function App() {
  return (
    <div className="App">
        <Header categories={categories}/>

    </div>
  );
}

export default App;
